```

### Step 3: Write the Bot Code
Now, create a file named `index.js` and write the bot code.

```javascript
// index.js

require('dotenv').config();
const { Client, GatewayIntentBits } = require('discord.js');
const fs = require('fs');
const path = require('path');

const client = new Client({
    intents: [
        GatewayIntentBits.GuildMessages,
        GatewayIntentBits.GuildMembers,
        GatewayIntentBits.GuildBans,
        GatewayIntentBits.MessageContent
    ]
});

const commandsPath = path.join(__dirname, 'commands');
const commandFiles = fs.readdirSync(commandsPath).filter(file => file.endsWith('.js'));

client.commands = new Map();

commandFiles.forEach(commandFile => {
    const filePath = path.join(commandsPath, commandFile);
    const command = require(filePath);

    if ('data' in command && 'execute' in command) {
        client.commands.set(command.data.name, command);
    } else {
        console.log(`[WARNING] The command at ${filePath} needs to export a "data" and "execute" property.`);
    }
});

client.on('ready', () => {
    console.log(`Logged in as ${client.user.tag}!`);
});

client.on('interactionCreate', async interaction => {
    if (!interaction.isCommand()) return;

    const command = client.commands.get(interaction.commandName);

    if (!command) return;

    try {
        await command.execute(client, interaction);
    } catch (error) {
        console.error(error);
        await interaction.reply({ content: 'There was an error while executing this command!', ephemeral: true });
    }
});

client.login(process.env.TOKEN);

// Example Command: ban1
// commands/ban1.js
module.exports = {
    data: {
        name: 'ban1',
        description: 'Ban a user from the server.'
    },
    execute: async (client, interaction) => {
        const targetUser = interaction.options.getUser('target') || interaction.user;
        const reason = interaction.options.getString('reason');

        if (!targetUser) {
            return interaction.reply('Please specify a user to ban.');
        }

        try {
            await interaction.guild.ban(targetUser);
            await interaction.reply(`Banned ${targetUser.tag} for the reason: ${reason || 'No reason provided.'}`);
        } catch (error) {
            console.error(error);
            return interaction.reply('An error occurred while trying to ban the user.');
        }
    }
};
```

