Creating a high-quality testing framework using Cypress with Docker involves several steps. This example will cover setting up a Dockerized environment, integrating Cypress for automated testing, and capturing screenshots when tests fail.

### Step 1: Setting Up the Project

First, let’s set up our project structure and install necessary dependencies.

#### Create the Project Structure:

```
my-cypress-docker-test/
├── cypress/
│   └── integration/
│       └── example_test.js
├── package.json
├── docker-compose.yml
└── README.md
```

### Step 2: Install Dependencies

In your terminal, navigate into your project directory and run:

```bash
npm init -y
npm install --save-dev cypress @testing-library/cypress @testing-library/react @testing-library/jest-dom react react-dom jest dotenv
```

### Step 3: Configure Cypress

Add the following configuration to `cypress/plugins/index.js`:

```javascript
const { defineConfig } = require('cypress');

module.exports = defineConfig({
  e2e: {
    setupNodeEvents(on, config) {
      // Setup custom commands here
      on('file:preprocessor', require('@cypress/code-coverage-preprocessor'));
    },
  },
});
```

### Step 4: Set Up Your Tests

Create an example test in `cypress/integration/example_test.js`:

```javascript
describe('Example Test Suite', () => {
  it('visits the home page', async () => {
    await cy.visit('http://localhost:3000');
    expect(cy.title()).to.eq('Welcome to my app!');
    // Add more expectations or actions as needed
  });

  it('should capture a screenshot on failure', () => {
    cy.visit('http://localhost:3000'); // Assuming your app is running on this port

    cy.get('#some-button').click();

    // Wait for the expected element to be visible
    cy.get('#expected-element').should('be.visible');

    // If the above condition fails, take a screenshot
    if (!cy.get('#expected-element').should('be.visible')) {
      cy.screenshot({ name: 'Failure on button click' });
    }
  });
});
```

### Step 5: Set Up Docker

Create a `Dockerfile` in the root of your project:

```dockerfile
# Use a base Node image
FROM node:latest AS build-env
WORKDIR /app
COPY package*.json ./
RUN npm install
COPY . .
RUN npm run build

# Build production image
FROM nginx:latest
COPY --from=build-env /app/build /usr/share/nginx/html
```

Create a `docker-compose.yml` file to start your React app and Cypress tests together:

```yaml
version: '3'
services:
  server:
    build: ./server
    ports:
      - "3000:3000"
    volumes:
      - ./server:/app
  cypress:
    build: .
    environment:
      CYPRESS_base_url: http://localhost:3000
    depends_on:
      - server
```

### Step 6: Running the Tests

Run your Cypress tests using Docker Compose:

```bash
docker-compose up -d
npm run test
```

Navigate to `http://localhost:8080` (the default Nginx port) and you should see Cypress UI open automatically.

### Summary

With this setup, Cypress runs in a Docker container, ensuring isolation from your development environment. The tests interact with a React app running in another container, allowing for seamless integration testing. Additionally, Cypress will automatically capture screenshots if tests fail, helping you diagnose issues more effectively.

