describe('Docker Test Suite', () => {
  before(() => {
    // Define Docker options
    const dockerOptions = {
      image: 'myapp',
      env: {
        DATABASE_URL: 'postgres://user:password@localhost:5432/mydatabase',
      },
    };

    // Start the Docker container
    cy.task('dockerRun', dockerOptions).then(container => {
      // Attach to the running container for communication
