In TypeScript, you can express the idea that a value might have multiple types, but in practice, it will only have a specific type, using a combination of conditional types and type inference. This can be achieved using a technique called "Type Guarding" or "Type Narrowing."

Here's an example to illustrate this:

Let's say you have a variable `value` that could potentially be of several types (e.g., `A`, `B`, or `C`), but in your code, you have additional information that narrows down its type to `A`. Here’s how you can express this:

```typescript
// Define possible types
type A = { id: string; name: string };
type B = { id: number; version: number };
type C = { id: number; name: string };

// Assume we have some function or logic that determines the type
function getType(value: any): 'A' | 'B' | 'C' {
    if (typeof value.id === 'string' && typeof value.name === 'string') {
        return 'A';
    } else if (typeof value.id === 'number' && typeof value.version === 'number') {
        return 'B';
    } else if (typeof value.id === 'number' && typeof value.name === 'string') {
        return 'C';
    }
    throw new Error('Unknown type');
}

// Create a type guard based on our logic
const isTypeA = <T extends A>(value: T): value is A => {
    return getType(value) === 'A';
};

// Example usage
let value: any = { id: 123, name: 'Alice' }; // Could be B or C

if (isTypeA(value)) {
    // In practice, value is of type A
    console.log(value.id); // Type of value is inferred as string
    console.log(value.name); // Type of value is inferred as string
} else {
    // Handle other cases
}
```

In this example:
- `getType` is a function that returns `'A'` if the input value matches the pattern of type `A`.
- `isTypeA` is a type guard function that checks if `value` is of type `A` and ensures the types are narrowed accordingly.

When you use the type guard (`isTypeA`) with the `value`, TypeScript infers that `value` must be of type `A` within the context of that guard, allowing you to work with the properties and methods expected for `A`.

This approach leverages TypeScript's type system to statically enforce the type you expect, even when dealing with dynamic values that might match multiple patterns.

