```latex
\documentclass{article}
\usepackage{tikz}

% Function to draw a square of given color (black or white)
\newcommand{\drawSquare}[4]{
  \draw[fill=#3] (#1,#2) rectangle (#1+#4,#2+#4);
  \draw[#3] (#1,#2) rectangle (#1+#4,#2+#4);
}

\begin{document}

% Define the size of the chessboard
\newlength{\squareWidth}
\setlength{\squareWidth}{0.5cm} % Adjust as needed

